export async function createQuery(
  db: DbType,
  query: Query,
  queryConfigId?: string,
  type?: 'api' | 'ngsi-v2',
): Promise<Query> {
  if (queryConfigId === undefined) {
    const queryConfig = await createQueryConfig(db, type ? type : 'ngsi-v2');
    queryConfigId = queryConfig.id;
  }
  query.queryConfigId = queryConfigId;

  const createdQueries = await db.insert(queries).values(query).returning();

  return createdQueries.length > 0 ? createdQueries[0] : null;
}

export async function getQueryById(
  db: DbType,
  queryId: string,
): Promise<Query> {
  const results = await db
    .select()
    .from(queries)
    .where(eq(queries.id, queryId));

  return results.length > 0 ? results[0] : null;
}
